import Graph from './graph/Graph';
import Organisation from './browsers/Organisation';

class Dashboard extends Component {

  render() {
    return (
      <div className="dashboard">
          <Organisation />
          <Graph />
      </div>
    )
  }
}

export default Dashboard;
